import { Button, Card } from "react-bootstrap";
import { NoteModal } from "../models/NoteModal"
import { FormatDate } from "../utility/FormatDate";

interface NoteProps {
    note: NoteModal,
    onNoteClicked: (note: NoteModal) => void,
    onDeleteClicked: (note: NoteModal) => void,
}

const Note = ({ note, onNoteClicked, onDeleteClicked }: NoteProps) => {

    const {
        title,
        text,
        createdAt,
        updatedAt
    } = note;

    let createdUpdatedText;
    if (updatedAt > createdAt) {
        createdUpdatedText = `Updated at : ${FormatDate(updatedAt)}`;
    } else {
        createdUpdatedText = `Created at : ${FormatDate(createdAt)}`;
    }

    return (
        <Card onClick={() => onNoteClicked(note)} className="ms-auto mt-2">
            <Card.Body>
                <Card.Title>{title}</Card.Title>
                <Card.Text>{text}</Card.Text>
            </Card.Body>
            <Card.Footer className="muted-text ms-auto">
                {createdUpdatedText}
            </Card.Footer>
            <Button variant="dark"
                onClick={(e) => {
                    onDeleteClicked(note)
                    e.stopPropagation()
                }}>
                Delete
            </Button>
        </Card>
    )
};

export default Note;
